import React from "react";
import styled from "styled-components";

const Wrapper = styled.section`
  position: absolute;
  width: 100%;
  height: 100%;
  left: 0;
  top: 0;
  & > .back {
    width: 100%;
    height: 100%;
    background-color: rgba(0, 0, 0, 0.5);
    position: absolute;
    left: 0;
    top: 0;
  }
`;
function Popup() {
  return (
    <Wrapper>
      <div className="back" />
      <div className="box"></div>
    </Wrapper>
  );
}

export default Popup;
